window.bookSummaryJSON = "<p><b>Finalist for the 2023 AUDIE AWARDS® for Audio Drama and Fantasy</b></p> <p><b>A brand-new full-cast audio production of </b><b><i>Good Omens</i></b><b>, the internationally beloved novel and collaboration by bestselling authors Neil Gaiman and Terry Pratchett. Starring Michael Sheen as Aziraphale, David Tennant as Crowley and Rebecca Front as the Narrator.</b><br> <br> According to <i>The Nice and Accurate Prophecies of Agnes Nutter</i>, <i>Witch</i> (the world's only <i>completely</i> accurate book of prophecies, written in 1655, before she exploded), the world will end on a Saturday. Next Saturday, in fact. Just before dinner.<br> <br> So, the armies of Good and Evil are amassing, Atlantis is rising, frogs are falling, tempers are flaring. Everything appears to be going according to Divine Plan.<br> <br> Except a somewhat fussy angel and a fast-living demon - both of whom have lived amongst Earth's mortals since The Beginning and have grown rather fond of the lifestyle - are not actually looking forward to the coming Rapture.<br> <br> And someone seems to have misplaced the Antichrist....</p> <p><b>Don't miss Season 2 of </b><b><i>Good Omens</i></b><b>, coming soon to Amazon Prime Video.</b></p> <p><b>DRAMATIS PERSONAE</b></p> <p><b>Supernatural Beings</b><br> <br> Rebecca Front: Narrator<br> Michael Sheen: Aziraphale<br> David Tennant: Crowley</p> <p><b>Humans</b><br> <br> Katherine Kingsley: Anathema Device<br> Arthur Darvill: Newton Pulsifer<br> Peter Forbes: Shadwell<br> Gabrielle Glaister: Madame Tracy and Agnes Nutter</p> <p><b>Them</b><br> <br> Louis Davison: Adam<br> Pixie Davies: Pepper<br> Chris Nelson: Wensleydale<br> Ferdinand Frisby Williams: Brian</p> <p><b>Ensemble</b><br> <br> Adjoa Andoh, Allan Corduner, Kobna Holdbrook-Smith, Josh Hopkins, Lorelei King, Matt Reeves and Lemn Sissay</p>"; 
